import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
                <NavBar/>

      </div>
    );
  }
}

class NavBar extends React.Component {
  render() {

    const imgURl= "../Assets/Icons/BrainFlix\ Logo.svg"
    return (
      <header class="header">
            <div class="header__logo">
              <p>Brainfix</p>
              <img className="logo-photo" src= {imgURl} ></img> 
            </div>

            <div class="header__links header__links--right">
              <input class="search" placeholder="Search..." />
              <p class="lastPressed"></p>
            </div>
      </header>
    );
  }

}


export default App;
